import {introdata, profile} from "./content_details";
import profileImage from "./assets/profile.jpg";

function Intro() {
    return(
        <div className="flex">
            <div className="intro-text font-bold leading-loose lg:p-20">
                <h1 className="lg:text-4xl sm:text-2xl">{introdata.title}</h1>
                <div className="description text-gray-400 lg:text-3xl sm:text-1xl ">
                    <p className="">{introdata.description.first}</p>
                    <p>{introdata.description.second}</p>
                </div>
            </div>

            <div className="profile-image ">
                <img src={profileImage} className="rounded-full h-40 w-40 mx-auto"/>
            </div>
        </div>
    )
}

export default Intro;
